import { Button, CardActionArea, CardActions, IconButton, CardHeader } from '@material-ui/core';
import { useEffect, useState } from 'react';
import { Card, CardContent, Grid, Typography } from '@material-ui/core'
import { Computer, DesktopWindows } from '@material-ui/icons';


const TestSSA = () => {

    return (
        <div>
            <Grid container direction="column" >
                <Grid item sm={3} md={3} xl={3}>
                    <Card>
                        <CardHeader title="Production" />


                        <CardContent style={{display:"inline", justifyContent:"center"}} >
                            <DesktopWindows style={{ fontSize: 70 }} />
                            <Typography>Master jenkins  </Typography>
                        </CardContent>


                    </Card>

                </Grid>

            </Grid>
        </div>

    );
}

export default TestSSA;
